import React from 'React'
import styled from 'styled-components'

const UL = styled.ul `
ul{
    list-style: none;
    display: flex;
    flex-flow: row nowrap;
}
li{
    padding:  18px 10 px;
}
`;
const RigutNav = () => {
    return(
        <UL>
            <li>MIGAS_PIGMENTOS</li>
            <li>POLVOS_PIGMENTOS</li>
            <li>TRANSLICIDOS</li>
        </UL>
    )

}
export default RigutNav
